import React from 'react';

// --- Cute SVG Icons for a more custom feel ---

const HeartIcon = () => (
  <svg className="w-5 h-5 inline-block text-pink-400 mr-2" fill="currentColor" viewBox="0 0 20 20">
    <path fillRule="evenodd" d="M3.172 5.172a4 4 0 015.656 0L10 6.343l1.172-1.171a4 4 0 115.656 5.656L10 17.657l-6.828-6.829a4 4 0 010-5.656z" clipRule="evenodd" />
  </svg>
);

const SparkleIcon = () => (
  <svg className="w-5 h-5 inline-block text-purple-400 mr-2" fill="currentColor" viewBox="0 0 20 20">
    <path d="M10 2.5a.75.75 0 01.75.75v1.5a.75.75 0 01-1.5 0v-1.5A.75.75 0 0110 2.5zM5.06 5.06a.75.75 0 00-1.06 1.06l1.06-1.06zM14.94 5.06a.75.75 0 001.06 1.06l-1.06-1.06zM10 17.5a.75.75 0 01-.75-.75v-1.5a.75.75 0 011.5 0v1.5a.75.75 0 01-.75.75zM3.999 10.75a.75.75 0 01.75-.75h1.5a.75.75 0 010 1.5h-1.5a.75.75 0 01-.75-.75zM13.75 10a.75.75 0 000 1.5h1.5a.75.75 0 000-1.5h-1.5zM5.06 14.94a.75.75 0 001.06-1.06l-1.06 1.06zM14.94 14.94a.75.75 0 00-1.06-1.06l1.06 1.06zM10 6a4 4 0 100 8 4 4 0 000-8z" />
  </svg>
);

const ShieldIcon = () => (
    <svg className="w-5 h-5 inline-block text-rose-400 mr-2" fill="currentColor" viewBox="0 0 20 20">
        <path fillRule="evenodd" d="M10 1.944A11.954 11.954 0 0115.5 3.336C17.97 4.49 19 6.833 19 9.5c0 4.142-3.358 7.5-7.5 7.5S4 13.642 4 9.5c0-2.667 1.03-5.01 3.5-6.164A11.954 11.954 0 0110 1.944zM9 13.5a1 1 0 112 0v-5a1 1 0 11-2 0v5zm0-8a1 1 0 112 0 1 1 0 01-2 0z" clipRule="evenodd" />
    </svg>
);


const GetStarted = () => {
  return (
    <div className="bg-pink-50 min-h-screen flex flex-col items-center p-6 font-sans overflow-hidden">



      {/* Hero Section */}
      <div className="text-center max-w-2xl mx-auto z-10 mb-24 animate-fade-in-down">
        <h2 className="text-2xl text-pink-400 mb-2" style={{ fontFamily: "'Nunito', sans-serif" }}>
          Because SafeSpace is all yours
        </h2>
        <h1 className="text-5xl md:text-6xl font-bold text-gray-700 mb-4" style={{ fontFamily: "'Poppins', sans-serif" }}>
          Write your mind, pour your heart
        </h1>
        <p className="text-lg text-gray-500 mb-8">
          Crafted just for you with only one goal: You are important and you will be heard.
        </p>
        <button className="bg-pink-500 text-white font-bold py-3 px-8 rounded-full shadow-lg hover:bg-pink-600 hover:scale-105 transform transition-all duration-300 ease-in-out">
          Get Started
        </button>
      </div>
      <div className="relative w-full flex flex-row max-w-2xl h-96 animate-fade-in-up">
        <div className="flex flex-col items-center justify-center w-1/2 p-6 bg-white rounded-lg shadow-lg">
          <ul>
            <li>My first pottery class</li>
          </ul>
        </div>
        <div className="flex flex-col items-center justify-center w-1/2 p-6 bg-white rounded-lg shadow-lg">
          <ul>
            <li>My first pottery class</li>
          </ul>
        </div>
        </div>
    </div>
  );
}

export default GetStarted;
